  input: 'TEXT,F3XA,,"Schedule A: There are several reasons as to why the ASDC Dollars
    for Democrats memo Schedule A does not correspond exactly to the amount of our
    receipts. Dollars for Democrats is an ongoing fundraising operation. The difference
    between the $85,000.00 and the $74,739.26 represents dues deducted by ASDC and
    fees directly related to the fundraising expense. Schedule H3: We failed with
    the original report to submit a revised H2 for JJ Dinner (02/09/2002), which detailed
    the change in allocation ratio from 50-50 to 48 - 52 for this event. In addition
    on the report for the period January 1 - March 31, 2002 an expense of $13.00 was
    misclassifed as administrative rather than JJ Dinner (02/09/2002). We have corrected
    this error on our April 15 Quarterly Report and are filing an amendment to this
    July 15 Quarterly Report. A review of all other expenses for this event and the
    related transfers indicate that the transfers were made within the allowable time
    and that the appropriate ratio was applied."'
